import React from 'react';
import { Diff, Hunk, parseDiff } from 'react-diff-view';
import 'react-diff-view/style/index.css';

const oldCode = `
function MyComponent() {
  return <div>Hello, old world!</div>;
}
`;

const newCode = `
function MyComponent() {
  return <div>Hello, new world!</div>;
}
`;

const diffText = `
--- oldCode
+++ newCode
@@ -1,5 +1,5 @@
 function MyComponent() {
-  return <div>Hello, old world!</div>;
+  return <div>Hello, new world!</div>;
 }
`;

const DiffViewer = () => {
  // Parsing the diff text into a structured diff object
  const [diff] = parseDiff(diffText);

  // If parsing fails or if there are no hunks, render a failure message
  if (!diff || !diff.hunks) {
    return <div>Failed to parse diff</div>;
  }

  // If parsing is successful, render the Diff component
  return (
    <Diff viewType="split" diff={diff}>
      {/* Rendering each hunk within the Diff component */}
      {diff.hunks > (diff.hunks || []).map(hunk => (
        <Hunk key={hunk.content} hunk={hunk} />
      ))}
    </Diff>
  );
};


const App = () => {
  return(
    <div>
      <h1> COde Diff Viewer</h1>
      <DiffViewer />  
    </div>
  );
};
export default App;
